import React from 'react';
import './App.css';
import {Link} from 'react-router-dom'

function Mainpage() {
  return (
    <div>
        <h1>Mainpage</h1>
        
        <Link to='/login'>Sign in</Link>
    </div>
  );
}

export default Mainpage;
